import React from "react";
import "../components/SignIn/style.scss";
import TextField from "@material-ui/core/TextField";
import { Box } from "@material-ui/core";
let width = 240;
let marginBottom = 5;
let headeFontSize = 20;
let choseSignInTypeHeight=30
let choseSignInTypeWidth="80%"

// * Style cho may cai nut chon loai dang nhap
let choseStyle={
  height:choseSignInTypeHeight,
  padding:0,
  marginBottom:10,
  width:choseSignInTypeWidth,
  fontSize:12,
  textTransform:"lowercase"
}
function Signin() {
  return (
    <div style={{display:"flex",flexDirection:"row"}}>
      <div className="login-page">
        <div className="form">
        <button type="submit" style={choseStyle}>Tên và mật khẩu</button>
        <button type="submit" style={choseStyle}>Google</button>
        <button type="submit" style={choseStyle}>Số điện thoại</button>
          
        </div>
      </div>
      <div className="login-page">
        <div className="form">
          <form
            className="login-form"
            // onSubmit={this.handleSubmit}
          >
            <div
              style={{
                display: "flex",
                flexDirection: "row",
                paddingLeft: 15,
                fontFamily: "Roboto",
              }}
            >
              <p style={{ color: "grey", fontSize: headeFontSize }}>
                Sign in to
              </p>
              <Box width={5} />
              <p style={{ fontWeight: "bold", fontSize: headeFontSize }}>
                Web Admin
              </p>
            </div>

            <TextField
              style={{ width: width, marginBottom: marginBottom }}
              type="text"
              variant="standard"
              label="username"
              name="username"
              // onChange={(event) => this.handleChange(event)}
            />
            <TextField
              style={{ width: width, marginBottom: marginBottom }}
              variant="standard"
              type="password"
              label="password"
              name="password"
              // onChange={(event) => this.handleChange(event)}
            />
            <div
              style={{
                textAlign: "right",
                color: "grey",
                paddingRight: 10,
                margin: "5px 5px 15px 0",
              }}
            >
              <p style={{ fontSize: 12, fontWeight: "bold" }}>
                Forgot password?
              </p>
            </div>
            <button type="submit">login</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Signin;
